var resultList = [
  {
    code: 200,
    msg: "成功",
    result: {
      image:
        "data:image/jpeg;base64,",
    },
  },
];

var resObj = JSON.parse(JSON.stringify(resultList[0]));

$("#returnresult").html(syntaxHighlight(resObj));

$(".analysis_name").click(function () {
  if (isUpload) {
    var uploadFiles = document.querySelector(".fileUpload");
    var file = uploadFiles.files[0]; //文件

    if (file) {
      var size = file.size / 1024 / 1024;
      if (size < 10) {
        document.querySelector("#marklayer").classList.add("mark-show"); //加载状态
        var formData = new FormData();
        formData.append("image", file);
        formData.append("projectId", projectId);
        $.ajax({
          method: "POST",
          headers: {
            "secret-id": secret_id,
            "secret-key": secret_key,
          },
          url: baseAPI + "/PicDetection",
          data: formData,
          contentType: false,
          processData: false,
          success: function (res) {
            document.querySelector("#marklayer").classList.remove("mark-show");
            if (res.code == 200) {
              $(".tips").css("display", "none");
              $("#analysis_results").css("display", "inline-block");
              $("#analysis_results img").attr("src", res.result.image);
              var result = syntaxHighlight({
                image: "base64IMG_file",
                projectId: projectId,
              });
              $("#result").html(result);
              let returnresult = syntaxHighlight(res);
              $("#returnresult").html(returnresult);
              if (res.result.info) {
                $("#analysis_results img").attr(
                  "src",
                  $(".pictures img").attr("src")
                );
                $(".message-error .message_content").html(res.result.info);
                $(".message-error").removeClass("message-hide");
                setTimeout(() => {
                  $(".message-error").addClass("message-hide");
                }, 2000);
              }
            }
          },
        });
      }
    }
  } else {
    document.querySelector("#marklayer").classList.add("mark-show"); //加载状态
    setTimeout(() => {
      document.querySelector("#marklayer").classList.remove("mark-show"); //加载状态
      $(".tips").css("display", "none");
      $("#analysis_results").css("display", "inline-block");
      $("#analysis_results img").attr("src", resultList[0].result.image);

      let resJSON = JSON.stringify(resultList[current]);
      resObj = JSON.parse(resJSON);
      let returnresult = syntaxHighlight(resObj);
      $("#returnresult").html(returnresult);
    }, 2000);
  }
});
